- input: "TEXT\x1CC00143743\x1C1\x1C\x1CF3XN\x1CSchedule B, line 21b reports reimbursements
    for travel expenses which are not itemized because they do not exceed the 200
    dollar itemization level and do not exceed the 200 dollar aggregate per vendor
    amount.  With respect to the expenditures made by the Party for payroll, payroll
    taxes, and other payroll or employee benefit-related expenses, the Party adheres
    to 11 CFR 300.33, and also follows the Commissions revision of the rules as adopted
    on December  1, 2005.  Specifically, the Party pays for these costs with 100 percent
    federal funds when the employee spends more than 25 percent of his or her time
    in a month on federal election activity (FEA) or activity in connection with a
    federal election.  These expenditures are reported on Schedule B for Line 30b.
    \ Alternatively, when an employee does not meet the 25 percent threshold, the
    Party allocates these costs as an overhead/administrative expense, and reports
    these disbursements on Schedule H4 or Line 21a.  Excess contribution from Peter
    Holt in the amount of $15,000 was transferred $10,000 to Levin Fund and $5,000
    to non-federal account on August 19, 2010 per redesignation permission from donor.
    \ We are seeking permisson for redesignation or reattribution for contribution
    by Mrs. Stuart Stedman on line 11a.\n"
